            <NavLink className="nav-link" to="/football/bundesliga">Bundesliga</NavLink>
            <NavLink className="nav-link" to="/football/seriea">Serie A</NavLink>
            <NavLink className="nav-link" to="/football/ligue">Ligue</NavLink>
            <NavLink className="nav-link" to="/football/saudi">Saudi</NavLink>
            <NavLink className="nav-link" to="/football/mexican">Mexican</NavLink>
            <NavLink className="nav-link" to="/football/mls">MLS</NavLink>
            <NavLink className="nav-link" to="/football/scottih">Scottish</NavLink>
            <NavLink className="nav-link" to="/football/portugese">Portugese</NavLink>
        </nav>

        <Outlet/>

        </div>
    )
}

export default Football;
